import React from "react";
import { useEffect, useState } from "react";
import axios from "axios";
import Swal from "sweetalert2";
import withReactContent from "sweetalert2-react-content";
import { show_alerta } from "../functions";

const MostrarProductos = () => {
    const url = 'http://127.0.0.1:8000/api/usuarios';
    const [usuarios, setUsuarios] = useState([]);
    const [id, setId] = useState('');
    const [nombre, setNombre] = useState('');
    const [apellido, setApellido] = useState('');
    const [edad, setEdad] = useState('');
    const [salario, setSalario] = useState('');
    const [operacion, setOperacion] = useState(1);
    const [title, setTitle] = useState('');

    useEffect(() => {
        getUsuarios();
    }, []);

    const getUsuarios = async () => {
        const respuesta = await axios.get(url);
        setUsuarios(respuesta.data);
    }

    return (
        <div className='App'>

<div className='container-fluid'>
        <div className='row mt-3'>
        <div className='col-md-4 offset-4'>
        <div className='d-grid mx-auto'>
           <button className='btn btn-dark' data-bs-toogle='modal' data-bs-target='#modalUsuarios'>
            <i className='fa-solid fa-circle-plus'></i> Añadir Usuario
            </button> 
        </div>
        </div>   
        </div>
            </div>
            <div className='row mt-3'>
             <div className='col-12 col-lg-8 offset-0 offset-lg-2'></div>
             <div className='table-responsive'>
                <table className='table table-bordered'>
                    <thead>
<tr><th>Id</th><th>nombre</th><th>apellido</th><th>edad</th><th>salario</th><th>operaciones</th></tr>

                    </thead>
                    <tbody className='table-group-divider'>
                        {usuarios.map((usuario,i)=>(
                            <tr key={usuario.id}>
<td>{(i+1)}</td>
<td>{usuario.nombre}</td>
<td>{usuario.apellido}</td>
<td>{usuario.edad}</td>
<td>{usuario.salario}</td>
<button className='btn btn-warning'>
    <i className='fa-solid fa-edit'></i>
</button>
&nbsp;
<button className='btn btn-danger'>
    <i className='fa-solid fa-trash'></i>
</button>

                            </tr>
                        )

                        )}
                    </tbody>
                </table>
             </div>
            </div>
       

            <div id='modalUsuarios' className='modal fade' aria-hidden='true'>
                <div className='modal-dialog'>
                    <div className='modal-content'>
                        <div className='modal-header'>
<label className='h5'>{title}</label>
<button type='button' className='btn-close' data-bs-dismiss='modal' aria-label='close'></button>
                        </div>
                        <div className='modal-body'>
                            <input type='hidden' id='id'></input>
                            <div className="input-group mb-3">
                                <span className='input-group-text'><i className='fa-solid fa-gift'></i></span>
                                <input type='text' id='nombre' className="form-control" placeholder="Nombre Usuario" value={nombre} onChange={(e)=>setNombre
                                (e.target.value)}></input>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default MostrarProductos
